    border: none;
    outline: none;
    background: none;
    cursor: pointer;
    left: 95%;
    top: 5%;
}

.modal div .modal-button span {
    display: block;
    width: 30px;
    height: 3px;
    margin-bottom: 5px;
    position: relative;

    background-color: #2e2e2e;
    border-radius: 5px;
    z-index: 1;

    transform-origin: 0 0;

    transition: 0.4s;
}

.modal div .modal-button span:nth-child(1) {
    transform: translate(-2px, -9px) rotate(45deg);
}

.modal div .modal-button span:nth-child(2) {
    transform: translate(-4px, 3px) rotate(-45deg);
}

.modal div .modal-button:hover span{
    transition: .3s ease-in-out;
    background-color: #005551;
}

.modal div .modal-photo {
    padding: 2rem;
    position: relative;

}

.modal div .modal-photo img {
    display: block;
    margin-left: auto;
    margin-right: auto;
    box-shadow: 0px 0px 10px 6px rgba(0, 0, 0, 0.6);

}

.modal div .modal-text {
    display: block;
    height: 100%;
    width: 100%;
    position: relative;
}

.modal div .modal-text .modal-text-wrapper {
    display: block;
    text-align: center;
    position: absolute;
    top: 50%;
    height: auto;
    transform: translateY(-50%);
    padding: 1rem;
}

.modal div .modal-text .modal-text-wrapper h2 {
    font-size: 3rem;
    margin-bottom: 1rem;
}

.modal div .modal-text .modal-text-wrapper p {
    font-size: 1.3rem;
}

@keyframes fade-in {
    0% {
      opacity: 0;
    }
    100% {
      opacity: 1;
    }
  }
  
  @keyframes fade-out {
    0% {
      opacity: 1;
    }
    100% {
      opacity: 0;
    }
  }

  @keyframes slide-up {
    0% {
      transform: translateY(100%);
    }
    100% {
      transform: translateY(0%);
    }
  }

  @keyframes slide-down {
    100% {
      transform: translateY(100%);
    }
    0% {
      transform: translateY(0%);
    }
  }
